import React from "react";
import Myauto from "./myauto";
import Header from "./header";
import Navbar from "./navbar";
import Main from "./main";
import data4 from "./data4.json";
import Filter from "./Filter";
import { useState } from "react";
import "./App1.css";
import "./App.css";

function App() {
  let IDs: number[] = [
    91350842, 92060138, 92836546, 92836546, 92835750, 86946439, 85990507,
    92792538,
  ];
  const items: object[] = data4.data.items;

  const [currency, setCurrency] = useState<string>("GEL");
  const [models, setModels] = useState<any[]>([]);

  const fetchModels = async (id: number) => {
    try {
      const response = await fetch(
        `https://api2.myauto.ge/ka/getManModels?man_id=${id}`
      );
      const data = await response.json();
      window.alert(data.length);
      setModels(data.data);
    } catch (error) {
      console.log(error);
    }
  };

  fetchModels(10);

  // window.alert(
  //   models.filter((vehicle) => vehicle.model_id === 253)[0].model_name
  // );

  return (
    <>
      <Header />
      <Myauto />
      <Filter selectCurrency={setCurrency} currency={currency} />
      <Navbar />
      <Main
        fetchModels={fetchModels}
        models={models}
        IDs={IDs}
        selectCurrency={setCurrency}
        currency={currency}
      />
    </>
  );
}

export default App;
